import React from "react";
import "../../styles/FeedBackPageStyles/FeedbackSafetyMeasureCard.css";
const SafetyMeasureCard = ({ img, description }) => {
  return (
    <div className="feedback_safetymeasure_card">
      <img src={img} alt="" />
      <p>{description}</p>
      <input type="checkbox" className="safetymeasure_card_checkbox" />
    </div>
  );
};

export default SafetyMeasureCard;
